+TextReplacements=(Category=Game, Namespace="", Key="0649648649B4C5C7C02CACAE9A63C9EC", NativeString="Includes customizable decals! Decals in this bundle are restricted to the Ford Bronco Raptor RLE car body. This car will fill the SUV slot in relevant Fortnite experiences.", LocalizedStrings=(("ar","تتضمن ملصقات قابلة للتخصيص! ملصقات هذه الحزمة مقتصرة على هيكل سيارة Ford Bronco Raptor. ستملأ هذه السيارة خانة سيارة الدفع الرباعي في تجارب Fortnite ذات الصلة."),("en","Includes customizable decals! Decals in this bundle are restricted to the Ford Bronco Raptor car body. This car will fill the SUV slot in relevant Fortnite experiences."),("de","Enthält anpassbare Aufkleber! Die Aufkleber in diesem Paket sind auf die Karosserie „Ford Bronco Raptor“ beschränkt. Dieses Auto belegt in relevanten Fortnite-Erlebnissen den SUV-Slot."),("es","¡Incluye calcomanías personalizables! Las calcomanías de este lote solo están disponibles para la carrocería del Ford Bronco Raptor. Este vehículo ocupará el espacio del SUV en las experiencias de Fortnite pertinentes."),("es-419","¡Incluye calcomanías personalizables! Las calcomanías de este lote solo están disponibles para la carrocería Ford Bronco Raptor. Este auto llenará el espacio de TrailSmasher en las experiencias de Fortnite pertinentes."),("fr","Comprend des stickers personnalisables ! Les stickers de ce pack ne fonctionnent que sur le châssis Ford Bronco Raptor. Ce véhicule sera placé dans l'emplacement SUV des expériences de Fortnite concernées."),("id","Termasuk stiker yang dapat dikustom! Stiker dalam bundel ini terbatas untuk bodi mobil Ford Bronco Raptor. Mobil ini akan mengisi slot SUV dalam pengalaman bermain Fortnite tertentu."),("it","Include adesivi personalizzabili! Gli adesivi di questo bundle sono limitati alla carrozzeria Ford Bronco Raptor. Questa auto occuperà lo slot SUV nelle esperienze di Fortnite del caso."),("ja","カスタマイズ可能なデカールが付属！ このバンドル内のデカールは、マシンのボディ「Ford Bronco Raptor」に限定されています。このマシンは、対応しているフォートナイトの体験においてSUVとして使用できます。"),("ko","커스터마이징 가능한 데칼 포함! 이 번들의 데칼은 Ford Bronco Raptor 차체에만 사용할 수 있습니다. 이 차량은 관련 포트나이트 경험에서 SUV 슬롯에 할당됩니다."),("pl","Zawiera konfigurowalne wzory! Wzory z tego zestawu można wykorzystać tylko w połączeniu z karoserią Ford Bronco Raptor. Ten samochód znajdzie się w polu SUV-a we wszystkich odpowiednich przygodach Fortnite."),("pt-BR","Inclui adesivos personalizáveis! Os Adesivos deste pacote são restritos ao Chassi Ford Bronco Raptor. Este carro preencherá o espaço de SUV nas experiências Fortnite relevantes."),("ru","Включает настраиваемые декали! Декали из этого комплекта совместимы только с кузовом Ford Bronco Raptor. Эта машина будет занимать ячейку внедорожников в соответствующих режимах Fortnite."),("th","มาพร้อมลายแต่งแบบปรับแต่งได้! ลายแต่งในบันเดิลนี้ใช้ได้เฉพาะกับตัวถังรถ Ford Bronco Raptor เท่านั้น รถคันนี้จะใช้ช่อง SUV ในประสบการณ์ Fortnite ที่เกี่ยวข้อง"),("tr","Özelleştirilebilir çıkartmalar içerir! Bu paketteki çıkartmaları yalnızca Ford Bronco Raptor araba gövdesiyle kullanabilirsin. Bu araba uygun Fortnite deneyimlerinde SUV yuvasını doldurur."),("vi","Bao gồm cả hình dán tùy chỉnh! Hình dán trong bộ quà này chỉ dành riêng cho thân xe Ford Bronco Raptor. Mẫu Xe này sẽ được đưa vào ô Xe SUV trong các chế độ chơi Fortnite phù hợp."),("zh-hans","包括可自定义的涂装！该同捆包中的涂装仅可用于Ford Bronco Raptor车体。在Fortnite相关体验中，该车会出现在SUV栏位。"),("zh-Hant","當中包含可自訂貼花！此組合包的貼花僅限 Ford Bronco Raptor 車身使用。此車輛會填入相關 Fortnite 體驗中的 SUV 欄位。")))
