+TextReplacements=(Category=Game, Namespace="IslandTagInternal", bIsMinimalPatch=True, Key="recommendations_info", NativeString="This island is being recommended to you based on your recently played games and your favorited Collections. It considers your recent play history and the play history of other opted-in users to recommend content to you.\n\n If you want to, you can opt-out of receiving personalized recommendations in Settings by modifying the “Allow Personalization of Island Recommendations” setting under Account and Privacy->Gameplay Privacy. If you opt-out, you will continue to see recommendations, but they will not be personalized.\n\n You can favorite Collections in Discover and unfavorite Collections in your Library.", LocalizedStrings=(("en","This island is being recommended to you based on your played games and your favorited Collections, Islands, and Creators. It considers your play history and the play history of other opted-in users to recommend content to you. If you want to, you can opt-out of receiving personalized recommendations in Settings by modifying the “Allow Personalization of Island Recommendations” setting under Account and Privacy->Gameplay Privacy. If you opt-out, you will continue to see recommendations, but they will not be personalized. If you want to, you can favorite Islands, Creators, and Collections in Discover and unfavorite Islands, Creators, and Collections in your Library."),("ar","تم ترشيح هذه الجزيرة لك بناءً على الألعاب التي لعبتها وما تفضله من المجموعات والجُزر والمبدعين. يوضع في الاعتبار سجل لعبك وسجل لعب المستخدمين المشتركين الآخرين عند ترشيح المحتوى لك. يمكنك إلغاء استلام ترشيحات مخصصة إذا أردت، وذلك من الإعدادات عبر تعديل إعداد “السماح بتخصيص مقترحات الجزيرة” أسفل الحساب والخصوصية ->خصوصية بيئة اللعب. بعد الإلغاء ستظل ترى ترشيحات، ولكنها لن تكون مخصصة.يمكنك إذا أردت أن تضيف للمفضلة المجموعات والجُزر والمبدعين في اكتشف، وأن تحذف من المفضلة المجموعات والجُزر والمبدعين في مكتبتك."),("de","Diese Insel wird dir aufgrund deiner gespielten Spiele und favorisierten Sammlungen, Inseln und Creators empfohlen. Dabei werden dein Spielverlauf und die Spielverläufe anderer teilnehmender Nutzer berücksichtigt, um dir Inhalte zu empfehlen. Wenn du möchtest, kannst du den Erhalt von personalisierten Empfehlungen in den Einstellungen ändern, indem du die Option „Personalisierte Inselempfehlungen zulassen“ unter „Konto und Datenschutz“ -> „Gameplay-Privatsphäre“ anpasst. Wenn du dich gegen den Erhalt entscheidest, wirst du zwar weiterhin Empfehlungen erhalten, diese werden aber nicht personalisiert sein. Wenn du möchtest, kannst du Inseln, Creators und Sammlungen im Entdecken-Bildschirm favorisieren und die Favorisierungen von Inseln, Creators und Sammlungen in deiner Bibliothek aufheben."),("es","Esta isla se te recomienda en función de los juegos a los que has jugado y de las colecciones, islas y creadores que has marcado como favoritos. Se tiene en cuenta tu historial de juego y el de otros usuarios que hayan habilitado esta opción para recomendarte contenido. Si no quieres recibir recomendaciones personalizadas, deshabilita la opción “Permitir personalización de las recomendaciones de islas” en Cuenta y privacidad > Privacidad de jugabilidad. Si decides no recibirlas, seguirás viendo recomendaciones, pero no serán personalizadas. Si quieres, puedes marcar como islas, colecciones y creadores como favoritos en Descubrir y desmarcarlos en tu biblioteca."),("es-419","Te recomendamos esta isla en función de los juegos que jugaste recientemente y de las colecciones, islas y creadores que marcaste como favoritos. Tiene en cuenta tu historial de juegos y el historial de juegos de otros usuarios que hayan habilitado esta opción para recomendarte contenido. Si no quieres recibir recomendaciones personalizadas, puedes modificar el ajuste “Permitir personalización de las recomendaciones de islas” en Cuenta y privacidad -> Privacidad de jugabilidad. Si decides no recibirlas, seguirás viendo recomendaciones, pero no serán personalizadas. Si lo prefieres, puedes marcar islas, creadores y colecciones como favoritos en Descubrir, así como quitarlos de tu biblioteca."),("fr","Cette île vous est recommandée en fonction des jeux auxquels vous avez joué et des collections, îles et créateurs que vous avez ajoutés à vos favoris. Cela est fondé sur votre historique de jeu ainsi que sur celui d'autres joueurs ayant validé cette option. Si vous le souhaitez, vous pouvez désactiver cette fonction dans les paramètres en modifiant l'option Personnaliser les recommandations d'îles. Pour ce faire, rendez-vous dans Compte et confidentialité, puis Confidentialité des parties. Vous verrez toujours des recommandations, mais elles ne seront plus personnalisées. Vous pouvez mettre des îles, des créateurs et des collections en favori dans le menu Découvrir et les retirer de vos favoris dans votre bibliothèque."),("it","Questa isola ti è stata consigliata in base ai giochi a cui hai giocato e alle Raccolte, alle isole e ai creatori che hai tra i preferiti. I contenuti consigliati si basano sulla tua cronologia di gioco e quella di altri utenti partecipanti. Se lo desideri, puoi disattivare i consigli personalizzati nelle Impostazioni modificando l'impostazione “Consenti la personalizzazione delle isole consigliate” all'interno dal menu Account e Privacy -> Privacy nel gioco. Se disattivi questa funzionalità, continuerai a ricevere consigli, ma non saranno personalizzati. Se lo desideri, puoi aggiungere isole, creatori e Raccolte ai preferiti in Scopri e rimuoverli dai preferiti nella tua libreria."),("ja","この島は、あなたがプレイしたゲームやお気に入り登録したコレクション、島、クリエイターに基づいておすすめされています。あなたのプレイ履歴と、この機能を利用することを選択したユーザーのプレイ履歴を利用し、あなたにコンテンツをおすすめします。ご希望する場合、「アカウントとプライバシー」 -> 「ゲームプレイプライバシー」での設定で「島のおすすめを個人向けにすることを許可する」を変更し、個人向けのおすすめの受け取りを拒否することができます。拒否した場合、引き続きおすすめは表示されますが、個人向けのものではなくなります。必要に応じて、ディスカバリーで島、クリエイター、コレクションをお気に入り登録したり、ライブラリでそれらのお気に入り解除をすることができます。"),("ko","플레이한 게임과 즐겨찾기한 컬렉션, 섬, 크리에이터에 기반한 추천 섬입니다. 플레이 기록과 다른 사용자들의 플레이 기록을 고려하여 내게 맞는 콘텐츠를 추천합니다. 원한다면 설정에서 계정 및 개인 정보 보호 -> 게임플레이 개인 정보 보호의 '맞춤형 섬 추천 허용' 설정을 변경하여 맞춤형 추천을 받지 않을 수 있습니다. 해제해도 추천 콘텐츠는 표시되지만 맞춤형으로 추천되지 않습니다. 원한다면 디스커버에서 섬, 크리에이터, 컬렉션을 즐겨찾기하고 라이브러리에서 섬, 크리에이터, 컬렉션 즐겨찾기를 해제할 수 있습니다."),("pl","Proponujemy tę wyspę na podstawie ostatnio rozegranych przez ciebie gier oraz twoich ulubionych kolekcji, wysp i twórców. Aby polecać zawartość, uwzględniamy twoją historię gier oraz historię gier innych użytkowników, którzy się na to zgodzili. Jeśli chcesz, możesz zrezygnować z otrzymywania spersonalizowanych rekomendacji, zmieniając opcję „Zezwól na personalizację rekomendacji wysp” w ustawieniach: Konto i prywatność -> Prywatność rozgrywki. Jeśli zrezygnujesz, nadal będziesz widzieć rekomendacje, lecz nie będą one personalizowane. Możesz dodawać wyspy, twórców i kolekcje do ulubionych w Odkryciach. Jeśli chcesz usunąć wyspy, twórców i kolekcje z ulubionych, zrobisz to w Bibliotece."),("pt-BR","Esta Ilha está sendo recomendada para você com base nos seus jogos e Coleções, Ilhas e Criadores favoritados. Levamos em conta o seu histórico de jogo e também o de outras pessoas que consentiram com as recomendações personalizadas. Caso queira, você pode desativar as recomendações personalizadas nas Configurações alterando a opção “Permitir personalização de recomendações de Ilhas” em Conta e Privacidade -> Privacidade de Jogo. Caso desative esta opção, você continuará recebendo recomendações, mas elas não serão personalizadas. Caso queira, você pode favoritar Ilhas, Criadores e Coleções na aba Descobrir e tirar Ilhas, Criadores e Coleções dos favoritos na sua Biblioteca."),("ru","Этот остров подобран на основе игр, в которые вы играли, ваших избранных коллекций, островов и авторов. Алгоритм учитывает историю ваших посещений, а также активность других пользователей, чтобы предложить вам наиболее подходящий контент. Чтобы отказаться от получения индивидуальных рекомендаций, выключите параметр «Разрешить персонализировать рекомендации островов» в разделе «Конфиденциальность игрового процесса» на вкладке «Учётная запись и конфиденциальность». В этом случае вы продолжите получать рекомендации, но уже не индивидуального, а общего характера. При необходимости в меню «Поиск» можно добавить острова, авторов и коллекции в избранное, а в «Библиотеке» — удалить их оттуда."),("tr","Bu ada oynadığın oyunlara ve favorilerine eklediğin koleksiyonlara, adalara ve içerik üreticilerine bağlı olarak sana önerilmektedir. Sana içerik önermek için oynadığın oyunlar ve katılan diğer oyuncuların oyun geçmişleri dikkate alınır. Kişiselleştirilmiş öneriler almak istemezsen, Hesap ve Gizlilik > Oynanış Gizliliği'ndeki “Ada Önerilerinin Kişiselleştirilmesine İzin Ver” ayarında değişiklik yaparak öneri almayı durdurabilirsin. İptal edersen öneriler almaya devam edersin ama bu öneriler kişiselleştirilmiş olmaz. İstersen Keşfet'ten adaları, içerik üreticilerini ve koleksiyonları favorilerine ekleyebilirsin ve kütüphanenden adaları, içerik üreticilerini ve koleksiyonları favorilerinden çıkarabilirsin."),("zh-hans","该岛屿是根据你最近玩过的游戏以及收藏的系列、岛屿和创作者推荐的。此功能结合你最近的游玩历史和其他开启此功能用户的游玩历史，向你推荐内容。如需关闭此功能，你可以在“设置”中修改“账号和隐私”->“游戏隐私”下的“允许个性化岛屿推荐”设置，选择拒绝接收个性化推荐。如果你选择关闭，你仍可以看到推荐，但这些推荐将不会经过个性化筛选。如有需要，你可以在“探索”页面收藏岛屿、创作者和系列，也可以在库中取消收藏。")))
+TextReplacements=(Category=Game, Namespace="IslandTagInternal", bIsMinimalPatch=True, Key="interests_info", NativeString="This island is being recommended to you because you asked to see more games like your favorited Collections. It does not consider your play history.\n\n If you want to, you can favorite Collections in Discover and unfavorite Collections in your Library.", LocalizedStrings=(("ar","تم ترشيح هذه الجزيرة لك لأنك طلبت مزيدًا من الألعاب التي تشبه ما تفضله من المجموعات والجُزر والمبدعين. لم يؤخذ في الاعتبار سجل لعبك.يمكنك إذا أردت أن تضيف للمفضلة المجموعات والجُزر والمبدعين في اكتشف، وأن تحذف من المفضلة المجموعات والجُزر والمبدعين في مكتبتك."),("en","This island is being recommended to you because you asked to see more games like your favorited Collections, Islands, and Creators. It does not consider your play history. If you want to, you can favorite Islands, Creators, and Collections in Discover and unfavorite Islands, Creators, and Collections in your Library."),("de","Diese Insel wird dir empfohlen, da du darum gebeten hast, mehr Spiele angezeigt zu bekommen, die deinen favorisierten Sammlungen, Inseln und Creators ähneln. Dein Spielverlauf wird dabei nicht berücksichtigt. Wenn du möchtest, kannst du Inseln, Creators und Sammlungen im Entdecken-Bildschirm favorisieren und die Favorisierungen von Inseln, Creators und Sammlungen in deiner Bibliothek aufheben."),("es","Esta isla se te recomienda porque solicitaste ver más juegos parecidos a las colecciones, islas y creadores que has marcado como favoritos. No tiene en consideración tu historial de juego. Si quieres, puedes marcar como islas, colecciones y creadores como favoritos en Descubrir y desmarcarlos en tu biblioteca."),("es-419","Te recomendamos esta isla porque querías ver más juegos parecidos a las colecciones, islas y creadores que marcaste como favoritos. No tiene en cuenta tu historial de juegos. Si lo prefieres, puedes marcar islas, creadores y colecciones como favoritos en Descubrir, así como quitarlos de tu biblioteca."),("fr","Cette île vous est recommandée parce que vous avez demandé de voir des jeux similaires aux collections, îles et créateurs que vous avez ajoutés à vos favoris. Cela ne tient pas compte de votre historique de jeu. Vous pouvez mettre des îles, des créateurs et des collections en favori dans le menu Découvrir et les retirer de vos favoris dans votre bibliothèque."),("it","Quest'isola ti è stata consigliata perché hai chiesto di vedere più giochi affini alle Raccolte, alle isole e ai creatori che hai tra i preferiti. Non considera la tua cronologia di gioco. Se lo desideri, puoi aggiungere isole, creatori e Raccolte ai preferiti in Scopri e rimuoverli dai preferiti nella tua libreria."),("ja","この島は、お気に入りに登録しているコレクション、島、クリエイターのようなゲームをもっと表示してほしいと希望されたのでおすすめされています。あなたのプレイ履歴は考慮されていません。 必要に応じて、ディスカバリーで島、クリエイター、コレクションをお気に入り登録したり、ライブラリでそれらのお気に入り解除をすることができます。"),("ko","이 섬은 즐겨찾기한 컬렉션, 섬, 크리에이터와 유사한 게임을 더 보길 원하셨기 때문에 추천되었습니다. 플레이 기록은 고려되지 않습니다. 원한다면 디스커버에서 섬, 크리에이터, 컬렉션을 즐겨찾기하고 라이브러리에서 섬, 크리에이터, 컬렉션 즐겨찾기를 해제할 수 있습니다.""),(""pl"",""Proponujemy tę wyspę, ponieważ życzysz sobie widzieć więcej gier podobnych do tych z list twoich ulubionych kolekcji, wysp i twórców. Nie uwzględniamy przy tym twojej historii gier. Możesz dodawać wyspy, twórców i kolekcje do ulubionych w Odkryciach. Jeśli chcesz usunąć wyspy, twórców i kolekcje z ulubionych, zrobisz to w Bibliotece."),("pt-BR","Esta Ilha está sendo recomendada porque você quis ver mais jogos similares a suas Coleções, Ilhas e Criadores favoritados. Esta recomendação não leva em conta seu histórico de jogos. Caso queira, você pode favoritar Ilhas, Criadores e Coleções na aba Descobrir e tirar Ilhas, Criadores e Coleções dos favoritos na sua Biblioteca."),("ru","Мы рекомендуем вам этот остров, потому что вы согласились на подбор игр в соответствии с вашими избранными коллекциями, островами и авторами. При этом ваша игровая активность не учитывается. При необходимости в меню «Поиск» можно добавить острова, авторов и коллекции в избранное, а в «Библиотеке» — удалить их оттуда."),("tr","Bu ada, favorilerine eklediğin koleksiyonlara, adalara ve içerik üreticilerine benzer oyunları görmeyi istediğin için sana önerilmektedir. Oyun geçmişin dikkate alınmaz. İstersen Keşfet'ten adaları, içerik üreticilerini ve koleksiyonları favorilerine ekleyebilirsin ve kütüphanenden adaları, içerik üreticilerini ve koleksiyonları favorilerinden çıkarabilirsin."),("zh-hans","该岛屿之所以推荐给你，是因为你想要看到更多类似收藏系列、岛屿和创作者的游戏。系统并未参考你的游玩历史。 如有需要，你可以在“探索”页面收藏岛屿、创作者和系列，也可以在库中取消收藏。")))
