+TextReplacements=(Category=Game, Namespace="", Key="C1A044944FDBBED3EA8468864CE865AC", NativeString="<whisper> And yes, you will be running these missions with a team. </> Let the games begin.", LocalizedStrings=(("ar","<whisper>ونعم، ستخوض تلك المهام مع فريق.</> فلنبدأ التحدي."),("en","<whisper> And yes, you will be running these missions with a team. </> Let the games begin."),("de","<whisper>Und ja, du wirst an diesen Missionen zusammen mit einem Team arbeiten.</> Mögen die Spiele beginnen."),("es","<whisper> Y sí, tendrás que completar estas misiones con un equipo. </> ¡Adelante!"),("es-419","<whisper> Y sí, tendrás que completar estas misiones en equipo. </> ¡Adelante!"),("fr","<whisper>Et oui, il faudra travailler en équipe pour effectuer ces missions.</> Allez, c'est parti ! "),("it","<whisper>E sì, svolgerai queste missioni in squadra.</> Che i giochi abbiano inizio."),("ja","<whisper> そう、キミはチームでこれらの任務に挑むんだ。</>さあ、始めよう。"),("ko","<whisper>그리고 맞아요. 팀과 함께 미션을 진행할 거예요.</> 게임을 시작해 보죠."),("pl","<whisper>  I tak, będziesz wykonywać te misje z drużyną. </> Czas zacząć zabawę."),("pt-BR","<whisper> E sim, você vai precisar realizar essas missões com uma equipe. </> Que os jogos comecem."),("ru","<whisper> Кстати, проходить эти миссии ты будешь вместе с командой. </> Начинаем игру."),("tr","<whisper> Ve evet, bu görevleri bir ekiple birlikte yapacaksın. </> Gösteri başlasın."),("zh-hans","<whisper>是的，你将和团队一起执行任务。</>开始干活吧。"),("zh-Hant","<whisper>沒錯，這些任務你會跟隊伍一起完成。</>開始吧。"),("id","<whisper> Dan ya, kamu akan menjalankan misi ini dengan tim. </> Mari mainkan gamenya."),("th","<whisper>แล้วก็แน่นอนว่าคุณจะต้องร่วมทีมกับคนอื่นเพื่อพิชิตภารกิจพวกนี้</> เริ่มเกมได้เลย"),("vi","<whisper>Và đúng vậy, bạn sẽ thực hiện những nhiệm vụ này cùng các đồng đội. </> Bắt đầu trò chơi thôi nào.")))
+TextReplacements=(Category=Game, Namespace="", Key="52B23EEC48B41AD27B12CABC2597DB7F", NativeString="Anyway, I\'ve got your next <emphasis>Assignments</> ready, if you\'re game.", LocalizedStrings=(("ar","على أي حال، لقد جهّزتُ لك <emphasis>أعمالك</> التالية، إذا كنت مستعدًا."),("en","Anyway, I\'ve got your next <emphasis>Assignments</> ready, if you\'re game."),("de","Wie dem auch sei, ich habe hier deine nächste <emphasis>Aufgabe</>, wenn du dafür bereit bist."),("es","Aquí tengo tu próxima <emphasis>tarea</> si ya te has preparado."),("es-419","Aquí tengo tu próxima <emphasis>tarea</> si ya te preparaste."),("fr","Enfin bref, votre prochaine <emphasis>affectation</> vous attend, si vous êtes de la partie."),("it","A ogni modo, ho la tua prossima <emphasis>attività</> pronta, se te la senti."),("ja","ところで、次の<emphasis>課題</>はもう準備できてるよ。やる気があればね。 "),("ko","어쨋든, 다음 <emphasis>임무</>를 준비했어요. 계속 하고 싶다면 말이죠. "),("pl","Tak czy inaczej, jeśli masz ochotę, mam już dla ciebie kolejne <emphasis>zadania</>."),("pt-BR","Mas enfim, já tenho suas próximas <emphasis>Designações</> aqui na mão, se você topar."),("ru","В любом случае, я уже подготовила для тебя <emphasis>задания</>. "),("tr","Her neyse, başlamak istiyorsan sıradaki <emphasis>görevlerin</> hazır."),("zh-hans","总之，如果你愿意，我已经给你准备好下一个<emphasis>任务</>了。"),("zh-Hant","總之，你的下一個<emphasis>任務</>我已經準備好了，如果你準備好的話。"),("id","Oh iya, aku sudah menyiapkan <emphasis>Tugas</> baru untukmu, kalau kamu mau."),("th","เอาเถอะ ฉันมี<emphasis>ภารกิจ</>อันใหม่พร้อมมอบหมายให้แล้ว ถ้าคุณยินดีทำน่ะนะ"),("vi","Nhân tiện, nếu bạn hứng thú thì tôi đã có sẵn trên <emphasis>Chỉ Thị</> cho bạn đây.")))
+TextReplacements=(Category=Game, Namespace="", Key="322FBD7645DCE99C6CF2C1A441E98621", NativeString="We\'ve got to <emphasis>Defend the Supernova Academy</>!", LocalizedStrings=(("ar","علينا <emphasis>حماية أكاديمية سوبرنوفا</>!"),("en","We\'ve got to <emphasis>Defend the Supernova Academy</>!"),("de","Wir müssen <emphasis>die Supernova Academy verteidigen</>!"),("es","¡Tenemos que <emphasis>defender la Academia Supernova</>!"),("es-419","¡Tenemos que <emphasis>defender la Academia Supernova</>!"),("fr","Nous devons <emphasis>défendre l'Académie Supernova</> !"),("it","Dobbiamo <emphasis>difendere l'Istituto Grangalassia</>!"),("ja","<emphasis>スーパーノヴァ・アカデミーを防衛するんだ</>！"),("ko","<emphasis>슈퍼노바 아카데미를 방어</>해야 해요."),("pl","Naszym zadaniem będzie <emphasis>obrona Akademii Supernowa!</>"),("pt-BR","Temos que defender o <emphasis>Instituto Supernova</>!"),("ru","Нам нужно <emphasis>защитить академию «Супернова»</>!"),("tr","<emphasis>Süpernova Akademisi\'ni savunmamız</> gerekiyor!"),("zh-hans","我们必须<emphasis>保卫超新星学院</>！"),("zh-Hant","我們得<emphasis>保衛超新星學院</>！"),("id","Kita harus <emphasis>Melindungi Akademi Supernova</>!"),("th","เราต้อง<emphasis>ปกป้องซูเปอร์โนวาอะคาเดมี</>!"),("vi","Chúng ta phải <emphasis>Bảo Vệ Học Viện Siêu Tân Tinh</>!")))
+TextReplacements=(Category=Game, Namespace="", Key="A16814654C32DA33FCFEAA8197404243", NativeString="Once you\'ve reached <emphasis>Max level as a Rift Ripper</>, come see me again.", LocalizedStrings=(("ar","عند وصولك للمستوى الأقصى في فئة <emphasis>ممزقة الصدع</> عُد لرؤيتي مجددًا."),("en","Once you\'ve reached <emphasis>Max level as a Rift Ripper</>, come see me again."),("de","Komm wieder zu mir, sobald du das <emphasis>maximale Level als Rissreißer erreicht hast</>."),("es","Una vez que llegues al <emphasis>nivel máximo como grietomante</>, ven a verme."),("es-419","Una vez que llegues al <emphasis>nivel máximo como grietomante</>, ven a verme."),("fr","Revenez me voir lorsque vous aurez atteint le <emphasis>niveau max en tant que virtuose des failles</>."),("it","Quando avrai raggiunto <emphasis>il livello massimo come Frangi-fenditure</>, torna a trovarmi."),("ja","<emphasis>リフト・リッパーとして最大のレベル</>に達したら、また会いに来て。"),("ko","<emphasis>균열 해체자로 최대 레벨</>을 달성하면, 다시 오세요."),("pl","Jak już osiągniesz <emphasis>maksymalny poziom Szczelinomanty</>, wrócić się ze mną zobaczyć."),("pt-BR","Quando você alcançar o <emphasis>o nível máximo de Rompe-fendas</>, venha me ver de novo."),("ru","Когда ты достигнешь <emphasis>максимального уровня в качестве потрошителя разлома</>, возвращайся ко мне."),("tr","<emphasis>Yırtıkbiçen olarak maksimum seviyeye</> ulaştığında tekrar beni görmeye gel."),("zh-hans","等你达到<emphasis>裂隙漫游者的最高等级</>，再来找我。"),("zh-Hant","當你達到<emphasis>裂域行者最高等級</>後，記得再來找我。"),("id","Ketika kamu sudah mencapai <emphasis>level Maks sebagai Pengendali Rift</>, kunjungi aku lagi ya."),("th","พอเก็บ<emphasis>เลเวลริฟต์ริปเปอร์จนตัน</>เมื่อไหร่ คุณกลับมาคุยกับฉันอีกทีนะ"),("vi","Khi bạn đạt <emphasis>Cấp độ cao nhất cho hệ anh hùng Hành Giả Khe Nứt</>, hãy đến gặp tôi.")))
+TextReplacements=(Category=Game, Namespace="", Key="E241184F468B134E56C4148C5AE1780D", NativeString="I\'m proud to be on <b>your</> team. Thank you. <whisper> Don\'t tell Hope I said that. </>", LocalizedStrings=(("ar","دعني أعبر عن فخري لكوني في <b>فريقك</>. أشكرك. <whisper>لا تخبر أمل أنني قلت هذا.</>"),("en","I\'m proud to be on <b>your</> team. Thank you. <whisper> Don\'t tell Hope I said that. </>"),("de","Ich bin stolz, Teil <b>deines</> Teams zu sein. Danke dir. <whisper>Sage Hope nicht, dass ich das gesagt habe.</>"),("es","Estoy orgullosa de ser parte de <b>tu</> equipo. Gracias. <whisper>No se lo digas a Hope. </>"),("es-419","Estoy orgullosa de ser parte de <b>tu</> equipo. Gracias. <whisper>No se lo digas a Hope. </>"),("fr","Je suis fière de faire partie de <b>votre</> équipe. Merci. <whisper>Ne répétez surtout pas ce que je viens de vous dire à Hope.</>"),("it","Sono orgogliosa di far parte della <b>tua</> squadra. Grazie. <whisper>Non dirlo a Hope, però.</>"),("ja","<b>キミと同じ</>チームの一員でいられて誇りに思うよ。ありがとう。<whisper>今のはホープには内緒だよ。</>"),("ko","<b>당신</> 팀의 일부라는 게 자랑스러워요. <whisper>이건 호프에겐 비밀이에요.</>"),("pl","To zaszczyt być w <b>twojej</> drużynie. <whisper> Ale... nie wspominaj o tym Nadziei, dobrze? </>"),("pt-BR","Tenho muito orgulho de fazer parte da <b>sua</> equipe. Obrigada. <whisper> Não conta pra Valentia que eu disse isso. </>"),("ru","Я горжусь тем, что <b>мы в одной</> команде. Спасибо. <whisper> Только не говори Хоуп, что я это сказала.</>"),("tr","<b>Senin</> ekibinde yer almak büyük bir onur. Teşekkür ederim. <whisper> Böyle dediğimi Umut\'a söyleme. </>"),("zh-hans","我很荣幸成为<b>你的</>队友。感谢你。<whisper>别告诉霍普这是我说的。</>"),("zh-Hant","我很自豪能夠成為<b>你的</>隊友，謝謝你。<whisper>別跟霍普說我這樣講了。</>"),("id","Senang menjadi bagian dari <b>timmu</>. Makasih ya! <whisper> Tapi jangan beri tahu Hope kalau aku bilang begini. </>"),("th","ฉันภูมิใจที่ได้อยู่ทีมเดียวกับ<b>คุณ</> ขอบคุณนะ <whisper>อย่าเอาที่ฉันพูดไปเล่าให้โฮปฟังล่ะ</>"),("vi","Tôi rất vinh dự được về đội <b>của bạn</>. Cảm ơn bạn. <whisper> Đừng bảo Hope tôi nói thế nhé. </>")))
